                       const Slice& key) {
  const char* pos = key.data();
  pos += 8;
  uint64_t timestamp = 0;
  if (port::kLittleEndian) {
    int bytes_to_fill = 8;
    for (int i = 0; i < bytes_to_fill; ++i) {
      timestamp |=
